  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:40.545241\",\n\t\"name\": \"bosque-del-apache-wilderness-a-report-on-wilderness-character-monitoring\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides a detailed summary
  of the baseline wilderness character assessment completed for the Bosque del Apache
  National Wildlife Refuge Wilderness, located in New Mexico. The purpose of this
  report is multi-dimensional. It establishes a wilderness character monitoring program
  for the Bosque del Apache Wilderness and provides baseline data for future trend
  analysis. An understanding of the information in this report may also aid resource
  specialists by informing management decisions within the Bosque del Apache Wilderness.
  Finally, this report is meant to accompany and explain the quantitative results
  of Bosque del Apache wilderness character assessment that have been entered into
  a national wilderness character monitoring database.  A total of 26 measures were
  used to assess the following: untrammeled quality, natural quality, undeveloped
  quality, and solitude or primitive and unconfined recreation quality.\",\n\t\"license_title\":
